import React from 'react';

import NavigationItem from './NavigationItem/NavigationItem';
import Aux from '../../../hoc/Aux/Aux';

const navigationItems = ( props ) => (
    <Aux className={props.styling}>
        <ula>
            <NavigationItem link="/">
                Home
            </NavigationItem>
            <NavigationItem link="/">
                About Me
            </NavigationItem>
            <NavigationItem link="/">
                Works
            </NavigationItem>
        </ula>
    </Aux>
);

export default navigationItems;
